import React from "react";
import AddNote from "../addNote/addNote";
import Note from "../note/note";
import "./notesList.css";
export default function NoteList(props) {
  return (
    <div classname="notes-list">
     
      <AddNote addNote={props.addNote} />
    </div>
  );
}
